	public static String pictureToString(String filePath) throws IOException {
		byte[] fileContent = FileUtils.readFileToByteArray(new File(filePath));
		String encodedString = Base64.getEncoder().encodeToString(fileContent);
		return encodedString;
	}
	
	public static void stringToPicture(String encodedString, String outputFileName) throws IOException {
		byte[] decodedBytes = Base64.getDecoder().decode(encodedString);
		FileUtils.writeByteArrayToFile(new File(outputFileName), decodedBytes);
	}
	
	private static String countNics() {
		
		String str = "UNKNOWN";
		
		try {
			URL url = new URL("https://benzenoids.lis-lab.fr/count_nics");
			
			HttpURLConnection connection = (HttpURLConnection) url.openConnection();
	        connection.setRequestMethod("GET");
	        int response=connection.getResponseCode();
	        
	        BufferedReader in= new BufferedReader(new InputStreamReader(connection.getInputStream()));
	        String input;
	        StringBuffer resp=new StringBuffer();
	        while ((input=in.readLine())!=null){
	            resp.append(input);
	        }
	        in.close();
	        
	        
	        str = resp.toString();
	        
		} catch (Exception e) {
			
			e.printStackTrace();
		}
		
		return str;
	}
	
